const brightestTLEs = await fetch('https://celestrak.com/NORAD/elements/visual.txt');
const brightestTLEsText = await brightestTLEs.text();

const brightestSatellites = brightestTLEsText.split('\n').map(line => line.trim()).reduce((accum, line, index) => {
  if (index % 3 - 1 === 0) {
  	const catalogId = line.slice(2, 8);
    accum.push(catalogId);
  }

  return accum;
}, []);

